import { useState } from 'react';
import { PersonalInfosStep } from './step/PersonalInfos/PersonalInfos';
import styles from './styles.module.scss';
import { PersonalInfosInterface } from './utils/personalInfos.zod.interface';

export default function RegisterScreen() {
  const [currentStep, setCurrentStep] = useState(1);
  const [formValues, setFormValues] = useState<PersonalInfosInterface>({} as PersonalInfosInterface);

  const handleSetValues = (values: PersonalInfosInterface) => {
    setFormValues(values);
  };

  return (
    <section className={styles.form__container}>
      <div className={styles.form__container__center}>
        <h1>Cadastre-se</h1>
        <PersonalInfosStep
          steps={{ current: currentStep, setCurrent: setCurrentStep }}
          form={{ values: formValues, setValues: handleSetValues }}
        />
      </div>
    </section>
  );
}
